import{_ as n,j as a,o as t,v as h}from"./chunks/framework.OuVixYWh.js";const i=JSON.parse('{"title":"Tuning và Monitoring trong Cassandra","description":"Tuning và Monitoring là hai khía cạnh quan trọng trong việc quản lý hiệu suất và độ tin cậy của hệ thống Cassandra. Bài viết này sẽ cung cấp cái nhìn tổng quan về cách tối ưu hóa hiệu suất và giám sát hệ thống Cassandra.","frontmatter":{"footer":true,"title":"Tuning và Monitoring trong Cassandra","description":"Tuning và Monitoring là hai khía cạnh quan trọng trong việc quản lý hiệu suất và độ tin cậy của hệ thống Cassandra. Bài viết này sẽ cung cấp cái nhìn tổng quan về cách tối ưu hóa hiệu suất và giám sát hệ thống Cassandra.","authors":["lethanh"],"date":"2025-05-31T00:00:00.000Z","outline":"deep","image":"https://static-cdn.thanhlv.com/study/thanhlv-study-2025/2025-06-01-tuning-va-monitoring/image-2025-3-20_11-9-55.png","draft":false,"group":"1. Cassandra"},"headers":[{"level":2,"title":"Các Cấu Hình Cassandra cho Hiệu Suất Tối Ưu","slug":"cac-cau-hinh-cassandra-cho-hieu-suat-toi-uu","link":"#cac-cau-hinh-cassandra-cho-hieu-suat-toi-uu","children":[{"level":3,"title":"1.1 Cấu hình phần cứng","slug":"_1-1-cau-hinh-phan-cung","link":"#_1-1-cau-hinh-phan-cung","children":[{"level":5,"title":"1.1.1 CPU","slug":"_1-1-1-cpu","link":"#_1-1-1-cpu","children":[]},{"level":5,"title":"1.1.2 RAM","slug":"_1-1-2-ram","link":"#_1-1-2-ram","children":[]},{"level":5,"title":"1.1.3 Ổ cứng","slug":"_1-1-3-o-cung","link":"#_1-1-3-o-cung","children":[]},{"level":5,"title":"1.1.4 Mạng","slug":"_1-1-4-mang","link":"#_1-1-4-mang","children":[]}]},{"level":3,"title":"1.2 Đánh Giá và Xác Định Node và Cluster","slug":"_1-2-đanh-gia-va-xac-đinh-node-va-cluster","link":"#_1-2-đanh-gia-va-xac-đinh-node-va-cluster","children":[{"level":4,"title":"1.2.1 Đánh giá nhu cầu.","slug":"_1-2-1-đanh-gia-nhu-cau","link":"#_1-2-1-đanh-gia-nhu-cau","children":[]},{"level":4,"title":"1.2.2 Xác định cấu hình","slug":"_1-2-2-xac-đinh-cau-hinh","link":"#_1-2-2-xac-đinh-cau-hinh","children":[]},{"level":4,"title":"1.2.3 Use case cụ thể","slug":"_1-2-3-use-case-cu-the","link":"#_1-2-3-use-case-cu-the","children":[{"level":5,"title":"High-Performance Applications","slug":"high-performance-applications","link":"#high-performance-applications","children":[]},{"level":5,"title":"Large Data Warehouses","slug":"large-data-warehouses","link":"#large-data-warehouses","children":[]}]}]},{"level":3,"title":"2.1 cấu hình phần mềm","slug":"_2-1-cau-hinh-phan-mem","link":"#_2-1-cau-hinh-phan-mem","children":[{"level":4,"title":"2.1.1 Cấu hình bộ nhớ và JVM","slug":"_2-1-1-cau-hinh-bo-nho-va-jvm","link":"#_2-1-1-cau-hinh-bo-nho-va-jvm","children":[]},{"level":4,"title":"2.1.2 Cấu hình trong cassandra.yaml","slug":"_2-1-2-cau-hinh-trong-cassandra-yaml","link":"#_2-1-2-cau-hinh-trong-cassandra-yaml","children":[]}]}]},{"level":2,"title":"Giám Sát và Điều Chỉnh Hiệu Suất của Cluster","slug":"giam-sat-va-đieu-chinh-hieu-suat-cua-cluster","link":"#giam-sat-va-đieu-chinh-hieu-suat-cua-cluster","children":[{"level":3,"title":"3.1 Monitoring Tools","slug":"_3-1-monitoring-tools","link":"#_3-1-monitoring-tools","children":[]},{"level":3,"title":"3.2 Performance Tuning:","slug":"_3-2-performance-tuning","link":"#_3-2-performance-tuning","children":[]}]}],"relativePath":"study/thanhlv-study-2025/2025-06-01-tuning-va-monitoring.md","filePath":"study/thanhlv-study-2025/2025-06-01-tuning-va-monitoring.md","lastUpdated":1750086653000}'),c={name:"study/thanhlv-study-2025/2025-06-01-tuning-va-monitoring.md"},l=[h('<nav class="table-of-contents"><ul><li><a href="#cac-cau-hinh-cassandra-cho-hieu-suat-toi-uu">Các Cấu Hình Cassandra cho Hiệu Suất Tối Ưu</a><ul><li><a href="#_1-1-cau-hinh-phan-cung">1.1 Cấu hình phần cứng</a><ul><li><a href="#_1-1-1-cpu">1.1.1 CPU</a></li><li><a href="#_1-1-2-ram">1.1.2 RAM</a></li><li><a href="#_1-1-3-o-cung">1.1.3 Ổ cứng</a></li><li><a href="#_1-1-4-mang">1.1.4 Mạng</a></li></ul></li><li><a href="#_1-2-đanh-gia-va-xac-đinh-node-va-cluster">1.2 Đánh Giá và Xác Định Node và Cluster</a><ul><li><a href="#_1-2-1-đanh-gia-nhu-cau">1.2.1 Đánh giá nhu cầu.</a></li><li><a href="#_1-2-2-xac-đinh-cau-hinh">1.2.2 Xác định cấu hình</a></li><li><a href="#_1-2-3-use-case-cu-the">1.2.3 Use case cụ thể</a><ul><li><a href="#high-performance-applications">High-Performance Applications</a></li><li><a href="#large-data-warehouses">Large Data Warehouses</a></li></ul></li></ul></li><li><a href="#_2-1-cau-hinh-phan-mem">2.1 cấu hình phần mềm</a><ul><li><a href="#_2-1-1-cau-hinh-bo-nho-va-jvm">2.1.1 Cấu hình bộ nhớ và JVM</a></li><li><a href="#_2-1-2-cau-hinh-trong-cassandra-yaml">2.1.2 Cấu hình trong cassandra.yaml</a></li></ul></li></ul></li><li><a href="#giam-sat-va-đieu-chinh-hieu-suat-cua-cluster">Giám Sát và Điều Chỉnh Hiệu Suất của Cluster</a><ul><li><a href="#_3-1-monitoring-tools">3.1 Monitoring Tools</a></li><li><a href="#_3-2-performance-tuning">3.2 Performance Tuning:</a></li></ul></li></ul></nav><h2 id="cac-cau-hinh-cassandra-cho-hieu-suat-toi-uu" tabindex="-1">Các Cấu Hình Cassandra cho Hiệu Suất Tối Ưu <a class="header-anchor" href="#cac-cau-hinh-cassandra-cho-hieu-suat-toi-uu" aria-label="Permalink to &quot;Các Cấu Hình Cassandra cho Hiệu Suất Tối Ưu&quot;">​</a></h2><h3 id="_1-1-cau-hinh-phan-cung" tabindex="-1">1.1 Cấu hình phần cứng <a class="header-anchor" href="#_1-1-cau-hinh-phan-cung" aria-label="Permalink to &quot;1.1 Cấu hình phần cứng&quot;">​</a></h3><p>Cấu hình phần cứng cho một node Cassandra phụ thuộc vào yêu cầu về hiệu suất, khả năng chịu lỗi, và mục đích sử dụng của cluster. Dưới đây là các khía cạnh chính cần xem xét khi chọn phần cứng:</p><h5 id="_1-1-1-cpu" tabindex="-1">1.1.1 CPU <a class="header-anchor" href="#_1-1-1-cpu" aria-label="Permalink to &quot;1.1.1 CPU&quot;">​</a></h5><p><strong>Yếu tố cân nhắc</strong>: Cassandra sử dụng CPU chủ yếu cho việc compaction và thực thi query. Nhiều core sẽ hỗ trợ tốt xử lý đồng thời nhiều query và compaction</p><p>Nếu hệ thống của bạn lớn, nên có số lượng CPU trên 8 core để đảm bảo hiệu suất tốt.</p><h5 id="_1-1-2-ram" tabindex="-1">1.1.2 RAM <a class="header-anchor" href="#_1-1-2-ram" aria-label="Permalink to &quot;1.1.2 RAM&quot;">​</a></h5><p>Bạn biết mà, Cassandra được viết bằng Java, vì vậy RAM sẽ ảnh hưởng đến kích thước của Heap JVm cũng như khả năng cache dữ liệu. Nhiều ram sẽ giúp giảm độ trễ.</p><p>Khuyến nghị tốt nhất hệ thống nên có trên 16GB RAM ở môi trường prod.</p><h5 id="_1-1-3-o-cung" tabindex="-1">1.1.3 Ổ cứng <a class="header-anchor" href="#_1-1-3-o-cung" aria-label="Permalink to &quot;1.1.3 Ổ cứng&quot;">​</a></h5><p>Cassandra là một database, vì vậy sẽ cần thực hiện đọc và ghi đĩa nhiều.</p><p>SSD có tốc độ đọc ghi cao hơn nhiều so với HDD, đặc biệt quan trọng cho việc giảm độ trễ và tăng hiệu suất I/O.</p><p>Khuyến nghị tốt nhất là sử dụng SSD để lưu trữ.</p><p>Nếu chi phí là một vấn đề lớn. Có thể sử dụng song song và SSD và HHD.</p><p>SSD sẽ lưu trữ các data hot có lượng yêu cầu sử dụng lớn và HDD sẽ lưu trữ các data có mức sử dụng thấp.</p><p>Ví dụ history 1 năm gần nhất sẽ lưu ở SSD còn từ 2 năm ở trên sẽ lưu ở HDD.</p><h5 id="_1-1-4-mang" tabindex="-1">1.1.4 Mạng <a class="header-anchor" href="#_1-1-4-mang" aria-label="Permalink to &quot;1.1.4 Mạng&quot;">​</a></h5><p>Cassandra là một hệ thống phân tán, do đó băng thông mạng và độ trễ là rất quan trọng.</p><p>Sử dụng mạng Gigabit Ethernet hoặc tốt hơn. Đảm bảo rằng mạng có độ trễ thấp và băng thông cao để hỗ trợ giao tiếp giữa các node.</p><p>Nếu các node Cassandra và ứng dụng kết nối với nhau trên cùng một data center vấn đề sẽ dễ giải quyết. Tuy nhiên nếu có nhiều data center thì cần lưu ý đến mạng.</p><h3 id="_1-2-đanh-gia-va-xac-đinh-node-va-cluster" tabindex="-1">1.2 Đánh Giá và Xác Định Node và Cluster <a class="header-anchor" href="#_1-2-đanh-gia-va-xac-đinh-node-va-cluster" aria-label="Permalink to &quot;1.2 Đánh Giá và Xác Định Node và Cluster&quot;">​</a></h3><h4 id="_1-2-1-đanh-gia-nhu-cau" tabindex="-1">1.2.1 Đánh giá nhu cầu. <a class="header-anchor" href="#_1-2-1-đanh-gia-nhu-cau" aria-label="Permalink to &quot;1.2.1 Đánh giá nhu cầu.&quot;">​</a></h4><ul><li><strong>Dung lượng dữ liệu</strong>: Ước tính tổng dung lượng dữ liệu và tốc độ tăng trường hằng tháng, năm. Điều này sẽ ảnh hưởng đến số lượng và loại ổ cứng cần thiết.</li><li><strong>Query</strong>: Xác định loại query và tần suất. các query đọc nhiều sẽ cần nhiều Ram hơn để hiệu suất cache tốt hơn.</li><li><strong>Service Level Agreement</strong>: Các yêu cầu về tính bền vững, tốc độ.</li></ul><h4 id="_1-2-2-xac-đinh-cau-hinh" tabindex="-1">1.2.2 Xác định cấu hình <a class="header-anchor" href="#_1-2-2-xac-đinh-cau-hinh" aria-label="Permalink to &quot;1.2.2 Xác định cấu hình&quot;">​</a></h4><ul><li><strong>Số lượng node</strong>: Dựa trên dung lượng dữ liệu và yêu cầu về khả năng chịu lỗi. Nhiều node hơn có thể cung cấp khả năng chịu lỗi tốt hơn để phân phối tải.</li><li><strong>Phân bổ địa lý</strong>: Đối với các ứng dụng yêu cầu độ trễ thấp trên diện rộng, cần cân nhắc sử dụng nhiều data center.</li></ul><h4 id="_1-2-3-use-case-cu-the" tabindex="-1">1.2.3 Use case cụ thể <a class="header-anchor" href="#_1-2-3-use-case-cu-the" aria-label="Permalink to &quot;1.2.3 Use case cụ thể&quot;">​</a></h4><h5 id="high-performance-applications" tabindex="-1">High-Performance Applications <a class="header-anchor" href="#high-performance-applications" aria-label="Permalink to &quot;High-Performance Applications&quot;">​</a></h5><ul><li><strong>Cấu hình</strong>: High-end CPUs, 32GB(Ram tối thiểu)+ RAM, all-SSD storage.</li><li><strong>Cluster</strong>: Nhiều node với replication để đảm bảo độ sẵn sàng cao và khả năng chịu lỗi.</li></ul><h5 id="large-data-warehouses" tabindex="-1">Large Data Warehouses <a class="header-anchor" href="#large-data-warehouses" aria-label="Permalink to &quot;Large Data Warehouses&quot;">​</a></h5><ul><li><strong>Cấu hình</strong>: Kết hợp SSD cho hot data và HDD cho cold data. Ram lớn để hỗ trợ các truy vấn lớn.</li><li><strong>Cluster</strong>: Lớn với nhiều node, có thể phân bố trên nhiều data center để cải thiện độ tin cậy và khả năng chịu lỗi.</li></ul><h3 id="_2-1-cau-hinh-phan-mem" tabindex="-1">2.1 cấu hình phần mềm <a class="header-anchor" href="#_2-1-cau-hinh-phan-mem" aria-label="Permalink to &quot;2.1 cấu hình phần mềm&quot;">​</a></h3><p>Cấu hình phần mềm cho Cassandra cũng rất quan trọng để đảm bảo hiệu suất tối ưu và độ tin cậy cao. Một phần cứng tốt nhưng chung ta chỉ sử dụng 1% hiệu suất của phần cứng thì vẫn có thể rẩt chậm hoặc không tối ưu tài nguyên.</p><p>các cấu hình của Cassandra chủ yếu được quản lý thông qua file <code>cassandra.yaml</code>, đây là tệp cấu hình chính của Cassandra. Tuy nhiên cũng sẽ có 1 số cấu hình khác không ở trong <code>cassandra.yaml</code></p><p>Dưới đây là 1 số cấu hình quan trọng:</p><h4 id="_2-1-1-cau-hinh-bo-nho-va-jvm" tabindex="-1">2.1.1 Cấu hình bộ nhớ và JVM <a class="header-anchor" href="#_2-1-1-cau-hinh-bo-nho-va-jvm" aria-label="Permalink to &quot;2.1.1 Cấu hình bộ nhớ và JVM&quot;">​</a></h4><ul><li><strong>heap_size</strong>: Đây là kích thước của heap cho JVM, bởi vì Cassandra được code bằng java. <ul><li><strong>Xms và Xmx</strong>: Giới hạn tối đa và thấp nhất của kích thước heap. Thông thường 2 giá trị này sẽ bằng nhau để trách sự giao động của heap size.</li><li><strong>Trường hợp sử dụng</strong>: Tăng giá trị này nếu bạn nhận thấy rằng Garbage Collection đang xảy ra quá thường xuyên hoặc Cassandra đang chạy chậm do thiếu bộ nhớ heap. Khi hết bộ nhớ GC sẽ được chạy để giải phóng heap.</li></ul></li></ul><h4 id="_2-1-2-cau-hinh-trong-cassandra-yaml" tabindex="-1">2.1.2 Cấu hình trong cassandra.yaml <a class="header-anchor" href="#_2-1-2-cau-hinh-trong-cassandra-yaml" aria-label="Permalink to &quot;2.1.2 Cấu hình trong cassandra.yaml&quot;">​</a></h4><ul><li><strong>num_tokens</strong>: Có thể nói đây là 1 cấu hình đặc biệt quan trọng. Cấu hình này giúp xác định có bao nhiêu dải token ngẫu nhiên được gán cho node này. <ul><li>Càng nhiều token so với các node khác thì tỉ lệ dữ liệu mà node này lưu trữ sẽ càng lớn.</li><li>Nếu tất cả các node có phần cứng giống nhau, chúng ta có thể để cấu hình này giống trên tất cả các node. Tuy nhiên nếu cấu hình phần cứng có sự khác nhau, cần được đánh giá để xác định giá trị cho cấu hình này. <ul><li>Ví dụ Node có phần cứng mạnh hơn có thể có nhiều token hơn so với các node khác.</li></ul></li><li>Nếu không cấu hình, default giá trị là 16(tùy phiên bản, có thể đã khác).</li><li>Mỗi một token sẽ quản lý một khoảng không gian token, chứ không chỉ là một giá trị token duy nhất <img src="https://static-cdn.thanhlv.com/study/thanhlv-study-2025/2025-06-01-tuning-va-monitoring/image-2025-3-20_11-9-55.png" alt="Image"></li><li><strong>Token Ring</strong> là gì ? <ul><li>Cassandra sử dụng mô hình token ring, nơi mà không gian token được hình dung như một vòng tròn liên tục. Mỗi node quản lý một phân đoạn của vòng tròn này. Token được sắp xếp theo thứ tự số, và mỗi node sẽ quản lý một khoảng từ token thấp nhất đến token cao nhất mà nó được gán.</li><li><strong>Lưu ý: Cài đặt num_tokens không nên thay đổi khi đã tham gia cluster.</strong></li></ul></li></ul></li><li><strong>allocate_tokens_for_local_replication_factor</strong>: Khi thêm 1 node mới, cấu hình này sẽ giúp phân bổ token trong cluster để giúp replication data một cách cân bằng dựa trên số node hiện có và replication factor.</li><li><strong>hinted_handoff_enabled(default true)</strong>: Cơ chế giúp xử lý tình huống khi việc đồng bộ bảng ghi đến node khác nhưng node đó không hoạt động, hệ thống sẽ hint lại, hint là một bản ghi tạm thời của thao tác ghi. Khi node khả hoạt động lại thì sẽ gửi lại.</li><li>và 1 số cấu hình hinted khác....</li><li><strong>authenticator</strong>: Cấu hình authen cho cassandra <ul><li><strong>AllowAllAuthenticator</strong>: Cho phép tất cả truy cập.</li><li><strong>PasswordAuthenticator</strong>: Cấu hình một username/password</li></ul></li><li><strong>authorizer</strong>: Cấu hình role</li><li>... 1 số cấu hình authen và author khác.</li><li><strong>data_file_directories</strong>: Đường dẫn đến thư mục lưu trữ dữ liệu của Cassandra. Nên sử dụng SSD để cải thiện hiệu suất đọc/ghi. Default là $CASSANDRA_HOME/data/data</li><li><strong>commitlog_directory</strong>: Đường dẫn đến thư mục lưu trữ commit log. Commit log là nơi ghi lại tất cả các thay đổi dữ liệu để đảm bảo tính nhất quán. Nên sử dụng SSD cho commit log để cải thiện hiệu suất ghi. Default là $CASSANDRA_HOME/data/commitlog</li><li><strong>cdc_enabled</strong>: Cấu hình này cho phép hoặc tắt tính năng Change Data Capture (CDC) trong Cassandra. Khi bật, Cassandra sẽ ghi lại các thay đổi dữ liệu để có thể theo dõi và xử lý sau này. Mặc định là false.</li><li><strong>commitlog_sync</strong>: Cách đồng bộ hóa commit log <ul><li><strong>Periodic</strong>: Đồng bộ hóa commit định kỳ dựa trên <strong>commitlog_sync_period_in_ms</strong></li><li><strong>batch</strong>: Khi đến 1 lượng dữ liệu nhất định sẽ thực hiện đồng bộ hóa.</li></ul></li><li><strong>Compaction</strong>: Cấu hình chiến lược compact dữ liệu để quản lý và tối ưu hóa việc lưu trữ dữ liệu</li><li><strong>concurrent_reads</strong>, <strong>concurrent_writes</strong> : Cấu hình số lượng concurrent cho việc đọc và ghi dữ liệu</li><li><strong>enable_materialized_views</strong>: Có hỗ trợ <strong>materialized_views</strong> không.</li><li><strong>read_request_timeout_in_ms</strong> và <strong>write_request_timeout_in_ms</strong>: Thời gian chờ tối đa cho yêu cầu đọc và ghi</li><li>và nhiều cấu hình khác nữa</li></ul><h2 id="giam-sat-va-đieu-chinh-hieu-suat-cua-cluster" tabindex="-1">Giám Sát và Điều Chỉnh Hiệu Suất của Cluster <a class="header-anchor" href="#giam-sat-va-đieu-chinh-hieu-suat-cua-cluster" aria-label="Permalink to &quot;Giám Sát và Điều Chỉnh Hiệu Suất của Cluster&quot;">​</a></h2><h3 id="_3-1-monitoring-tools" tabindex="-1">3.1 Monitoring Tools <a class="header-anchor" href="#_3-1-monitoring-tools" aria-label="Permalink to &quot;3.1 Monitoring Tools&quot;">​</a></h3><ul><li><strong>JMX (Java Management Extensions)</strong>: Cassandra cung cấp nhiều MBeans để giám sát hiệu suất và trạng thái của cluster. Bạn có thể sử dụng JConsole hoặc VisualVM để kết nối và theo dõi các MBeans này.</li><li><strong>Prometheus và Grafana</strong>: Sử dụng Prometheus để thu thập số liệu từ Cassandra và Grafana để trực quan hóa chúng. Cassandra có thể được cấu hình để xuất số liệu Prometheus thông qua JMX Exporter.</li><li><strong>OpsCenter</strong>: Đây là một công cụ giám sát và quản lý cluster Cassandra, cung cấp giao diện người dùng đồ họa để theo dõi hiệu suất, trạng thái và các vấn đề của cluster.</li><li><strong>Cassandra Reaper</strong>: Công cụ này giúp quản lý và giám sát quá trình compaction trong Cassandra, cung cấp thông tin về tình trạng compaction và hiệu suất của cluster.</li><li><strong>Nodetool</strong>: là một công cụ cli cho phép quản lý cluster cassandra và thu thập các thông số. <ul><li><code>nodetool status</code>: Hiển thị trạng thái các node trong cluster <img src="https://static-cdn.thanhlv.com/study/thanhlv-study-2025/2025-06-01-tuning-va-monitoring/image-2025-3-20_11-36-42.png" alt="Image"></li><li><strong>nodetool cfstats</strong>: Cung cấp chi tiết về các table theo từng keyspace</li><li><strong>nodetool tpstats</strong>: Các thông kê về thread ...etc.. giúp phát hiện tắc nghẽn</li><li>... <a href="https://docs.datastax.com/en/cassandra-oss/3.x/cassandra/tools/toolsNodetool.html" target="_blank" rel="noreferrer">https://docs.datastax.com/en/cassandra-oss/3.x/cassandra/tools/toolsNodetool.html</a></li></ul></li></ul><h3 id="_3-2-performance-tuning" tabindex="-1">3.2 Performance Tuning: <a class="header-anchor" href="#_3-2-performance-tuning" aria-label="Permalink to &quot;3.2 Performance Tuning:&quot;">​</a></h3><ul><li><strong>Garbage Collection Tuning</strong>: Tối ưu hóa thời gian và hiệu suất của GC để giảm độ trễ và tăng throughput.</li><li><strong>Data Model Optimization</strong>: Thiết kế lại mô hình dữ liệu để giảm độ phức tạp và số lượng vòng lặp trong các truy vấn.</li><li><strong>Query Performance</strong>: Phân tích và tối ưu hóa các truy vấn, sử dụng các chỉ mục phù hợp để cải thiện hiệu suất truy vấn. <ul><li>Sử dụng công cụ cqlsh và TRACING On để thực hiện điều này <img src="https://static-cdn.thanhlv.com/study/thanhlv-study-2025/2025-06-01-tuning-va-monitoring/image-2025-3-20_11-42-42.png" alt="Image"></li></ul></li></ul><h1 id="ref" tabindex="-1">REF: <a class="header-anchor" href="#ref" aria-label="Permalink to &quot;REF:&quot;">​</a></h1><ul><li><a href="https://thelastpickle.com/blog/2021/01/29/impacts-of-changing-the-number-of-vnodes.html" target="_blank" rel="noreferrer">https://thelastpickle.com/blog/2021/01/29/impacts-of-changing-the-number-of-vnodes.html</a></li></ul>',46)];const e=n(c,[["render",function(n,h,i,c,e,u){return t(),a("div",null,l)}]]);export{i as __pageData,e as default};
